" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 486px\">",
"   <div class=\"ttl\">",
"    Ultrasound image of acute calculous cholecystitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 466px; height: 454px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    There are two shadowing gallstones (S)&nbsp;lying dependently at the base of the distended gallbladder, associated with diffuse thickening of the gallbladder wall (arrows). There is no definite fluid accumulation in the gallbladder fossa. In the presence of a positive sonographic Murphy's sign, or appropriate clinical setting, a diagnosis of acute calculous cholecystitis can be established.",
"    <div class=\"footnotes\">",
