"    Bakri balloon for management of postpartum hemorrhage",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 527px; height: 540px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A) The Bakri balloon catheter is used for temporary control or reduction of postpartum hemorrhage when conservative management of uterine bleeding is warranted. It is easy to place and rapidly achieves tamponade within the uterine cavity, thereby potentially avoiding a hysterectomy. The tip allows drainage of accumulated blood. B) Under ultrasound guidance, the balloon portion of the catheter is inserted into the uterus, making certain that the entire balloon is inserted past the cervical canal and internal ostium. C) The device is intended for one-time use.",
