var title_f43_8_44172="Differential diagnosis of claudication";
var content_f43_8_44172=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F50130&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F50130&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of claudication",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"7\" width=\"14%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Condition",
"       </td>",
"       <td class=\"subtitle1\">",
"        Location of pain or discomfort",
"       </td>",
"       <td class=\"subtitle1\">",
"        Character of discomfort",
"       </td>",
"       <td class=\"subtitle1\">",
"        Onset relative to exercise",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect of rest",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect of body position",
"       </td>",
"       <td class=\"subtitle1\">",
"        Other features",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Intermittent claudication",
"       </td>",
"       <td>",
"        Buttock, thigh, or calf muscles and rarely the foot",
"       </td>",
"       <td>",
"        Cramping, aching, fatigue, weakness, or pain",
"       </td>",
"       <td>",
"        After some degree of exercise",
"       </td>",
"       <td>",
"        Quickly relieved",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        Reproducible",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Nerve root compression (eg, herniated disc)",
"       </td>",
"       <td>",
"        Radiates down leg, usually posteriorly",
"       </td>",
"       <td>",
"        Sharp lancinating pain",
"       </td>",
"       <td>",
"        Soon after, if not immediately after onset",
"       </td>",
"       <td>",
"        Not quickly relieved. (Also, often present at rest)",
"       </td>",
"       <td>",
"        Adjusting back position may relieve pain",
"       </td>",
"       <td>",
"        History of back problems",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Spinal stenosis",
"       </td>",
"       <td>",
"        Hip, thigh, or&nbsp;buttock (within affected dermatome)",
"       </td>",
"       <td>",
"        Motor weakness more prominent than pain",
"       </td>",
"       <td>",
"        After walking or standing for some length of time",
"       </td>",
"       <td>",
"        Relieved by resting only if position changed",
"       </td>",
"       <td>",
"        Relieved by lumbar spine flexion (sitting or stooping forward)",
"       </td>",
"       <td>",
"        Frequent history of back problems, provoked by intraabdominal pressure",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Hip arthritis",
"       </td>",
"       <td>",
"        Hip, thigh, buttocks",
"       </td>",
"       <td>",
"        Aching discomfort, usually localized to hip and gluteal region",
"       </td>",
"       <td>",
"        After variable degree of exercise",
"       </td>",
"       <td>",
"        Not quickly relieved (and may be present at rest)",
"       </td>",
"       <td>",
"        More comfortable sitting (ie, weight taken off legs)",
"       </td>",
"       <td>",
"        Variable, may relate to activity level, weather changes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Arthritic, inflammatory processes",
"       </td>",
"       <td>",
"        Foot, arch",
"       </td>",
"       <td>",
"        Aching pain",
"       </td>",
"       <td>",
"        After variable degree of exercise",
"       </td>",
"       <td>",
"        Not quickly relieved (and may be present at rest)",
"       </td>",
"       <td>",
"        May be relieved by not bearing weight",
"       </td>",
"       <td>",
"        Variable, may relate to activity level",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Venous claudication",
"       </td>",
"       <td>",
"        Entire leg, but usually worse in thigh and groin",
"       </td>",
"       <td>",
"        Tight, bursting pain",
"       </td>",
"       <td>",
"        After walking",
"       </td>",
"       <td>",
"        Subsides slowly",
"       </td>",
"       <td>",
"        Relief speeded by elevation of the extremity",
"       </td>",
"       <td>",
"        History of iliofemoral deep vein thrombosis, signs of venous congestion, edema",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Dormandy JA, Rutherford RB. Management of peripheral arterial disease (PAD). TASC Working Group. TransAtlantic Inter-Society Concensus (TASC). J Vasc Surg 2000; 31:S1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
