var title_f43_8_44174="Calcium scores CHD men women";
var content_f43_8_44174=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F52901&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F52901&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 545px\">",
"   <div class=\"ttl\">",
"    Diagnostic yield of calcium screening in symptomatic men and women",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 525px; height: 351px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In a study of 1764 symptomatic patients with suspected coronary heart disease who underwent electron beam computed tomography (EBCT) and coronary angiography, the calcium score on EBCT correlates with the presence or absence of a significant stenosis on angiography. The higher scores (A for men and C for women) define the calcium score thresholds (CSTs) for the 90 percent of patients with significant stenoses, while the lower scores (B for men and D for women) define the CSTs for the 95 percent of patients without significant stenoses. For example, a man at the age of 50 years is probably free of coronary stenosis if his score is &lt;56. At score values &gt;217, he has a high risk of coronary stenosis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Haberl R, Becker A, Leber A, et al. J Am Coll Cardiol 2001; 37:451.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f43_8_44174=[""].join("\n");
var outline_f43_8_44174=null;
var title_f43_8_44175="Mechanism of statins";
var content_f43_8_44175=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F57263&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F57263&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 540px\">",
"   <div class=\"ttl\">",
"    Statins and cholesterol synthesis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 520px; height: 578px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Inhibition of HMG CoA reductase reduces intracellular cholesterol levels; this activates a protease, which in turn cleaves sterol regulatory element-binding proteins (SREBP's) from the endoplasmic reticulum. The SREBP's translocate to the nucleus where they upregulate expression of the LDL receptor gene. Enhanced LDL receptor expression increases receptor-mediated endocytosis of LDL and thus lowers serum LDL. Inhibition of HMG CoA reductase also reduces intracellular levels of isoprenoids, which are intermediates in cholesterol biosynthesis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: Vaughan, CJ, Gotto, AM, Basson, CT. J Am Coll Cardiol 2000; 35:1. Copyright &copy; 2000 American College of Cardiology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
